  <Wrapper>
    <Content>
      <h1>DO THE FIVE: &nbsp;&nbsp;&nbsp; <small>1. STAY <i>home</i> &nbsp;&nbsp; 2.KEEP <i>distance</i> &nbsp;&nbsp; 3. WASH <i>hands often</i> &nbsp;&nbsp; 4. COVER <i>your cough</i> &nbsp;&nbsp;  5. SICK? <i>call ahead!</i></small></h1>
